//选定 RA=277.5 DEC=-40

func isCross(a, b, c, d cst) bool {
	var ac, bc, ad, bd, ca, cb, da, db cst
	var r1, r2 float64
	ac.RA = a.RA - c.RA
	ac.DEC = a.DEC - c.DEC
	ad.RA = a.RA - d.RA
	ad.DEC = a.DEC - d.DEC
	r1 = ac.RA*ad.DEC - ad.RA*ac.DEC
	bc.RA = b.RA - c.RA
	bc.DEC = b.DEC - c.DEC
	bd.RA = b.RA - d.RA
	bd.DEC = b.DEC - d.DEC
	r2 = bc.RA*bd.DEC - bd.RA*bc.DEC
	//echo r1.' '.r2;
	if r1*r2 > 0 {
		return false
	}
	ca.RA = c.RA - a.RA
	ca.DEC = c.DEC - a.DEC
	cb.RA = c.RA - b.RA
	cb.DEC = c.DEC - b.DEC
	r1 = ca.RA*cb.DEC - cb.RA*ca.DEC
	da.RA = d.RA - a.RA
	da.DEC = d.DEC - a.DEC
	db.RA = d.RA - b.RA
	db.DEC = d.DEC - b.DEC
	r2 = da.RA*db.DEC - db.RA*da.DEC
	if r1*r2 > 0 {
		return false
	}
	return true
}

func IsXZ(ra, dec, jde float64) string {
	var nra, ndec float64
	nra = ra
	if ra >= 360 {
		nra -= 360
	}
	nra, ndec = ZuoBiaoSuiCha(nra, dec, jde, 2451545.0)
	if ra >= 360 && nra < 270 {
		nra += 360
	}
	for k, v := range CstLists {
		var count int = 0
		for i := 0; i < len(v)-1; i++ {
			if k == "UMI" || k == "OCT" {
				continue
			}
			if i == 0 {
				if isCross(cst{277.5, -100}, cst{nra, ndec}, v[len(v)-1], v[0]) {
					count++
				}
			}
			if isCross(cst{277.5, -100}, cst{nra, ndec}, v[i], v[i+1]) {
				count++
			}
			if FR((nra-277.5)*(v[i].DEC+100)) == FR((v[i].RA-277.5)*(ndec+100)) {
				count++
			}
		}
		if count%2 == 1 {
			return k
		}
	}
	if nra <= 270 {
		ra = ra + 360
		return IsXZ(ra, dec, jde)
	}
	if ndec > 50 {
		return "UMI"
	} else if ndec < -50 {
		return "OCT"
	}
	return ""
}

